Quadro Nuevo is a German acoustic quartet which was founded in 1996 and can be categorized as World Music and Jazz. The band is comprised of Robert Wolf, Mulo Francel, D.D. Lowka and Andreas Hinterseher (original Heinz-Ludger Jeromine). Within the last decade the band played about 1500 concerts all over the world and is with its numerous awards and Chart Positions among the internationally most successful German Jazz Bands. Their style is a composition of (cit. Quadro Nuevo) &quot;Tango, Valse Musette, Flamenco, lovely dedusted filmmusic and an almost faded Italy&quot;.
